import styled from "styled-components"

export const Container = styled.div`
    background: #FFFFFF;
`;

export const Header = styled.div`
    background: #FFFFFF;
    height: 64px;
`;

export const HeaderButtonLeft = styled.button`
    top: 18px;
    margin-left: 10px;
    left: 10px;
    position: absolute;
    border-radius: 10px;
    border: none;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    position: absolute;
    border-radius: 10px;
    top: 18px;
    border: none;
`;

export const Title = styled.h1`
    position: relative;
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    top: 16px;
`;

export const Container1 = styled.div`
    height: 57px;
    width: 315px;
    left: 30px;
    top: 349px;
    border-radius: 16px;
    position: absolute;
    right: 30px;
    bottom: 559px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    opacity: 0.2;
`;

export const Text1 = styled.text`
    position: absolute;
    left: 50px;
    right: 183px;
    top: 367px;
    bottom: 577px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 500;
    font-size: 14px;
    line-height: 21px;
    color: #1D1617;
`;

export const Container2 = styled.div`
    position: absolute;
    width: 68px;
    height: 28px;
    left: 257px;
    right: 50px;
    top: 364px;
    bottom: 573px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    border-radius: 50px; 
`;

export const Text2 = styled.text`
    position: absolute;
    left: 26%;
    right: 65px;
    top: 15%;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #FFFFFF;
`;

export const Text3 = styled.text`
    position: absolute;
    width: 103px;
    height: 24px;
    left: 30px;
    top: 439px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    line-height: 24px;
    color: #1d1617;
`;

export const Container3 = styled.div`
    position: absolute;
    width: 315px;
    height: 93px;
    left: 30px;
    top: 608px;
    background: #FFFFFF;
    box-shadow: 0px 10px 40px rgba(29, 22, 23, 0.07);
    border-radius: 20px;
`;

export const Text4 = styled.text`
    position: absolute;
    width: 120px;
    height: 24px;
    left: 90px;
    top: 628px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 500;
    font-size: 14px;
    line-height: 24px;
    color: #1D1617;
`;

export const Text5 = styled.text`
    position: absolute;
    width: 145px;
    height: 24px;
    left: 90px;
    top: 657px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 24px;
    color: #7B6F72;
`;

export const Container4 = styled.div`
    position: absolute;
    width: 315px;
    height: 93px;
    left: 30px;
    top: 716px;
    background: #FFFFFF;
    box-shadow: 0px 10px 40px rgba(29, 22, 23, 0.07);
    border-radius: 20px;
`;

export const Text6 = styled.text`
    position: absolute;
    width: 100px;
    height: 24px;
    left: 90px;
    top: 736px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 500;
    font-size: 14px;
    line-height: 24px;
    color: #1D1617;
`;

export const Text7 = styled.text`
    position: absolute;
    width: 152px;
    height: 24px;
    left: 90px;
    top: 765px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 24px;
    color: #7B6F72;
`;

export const Container5 = styled.div`
    position: absolute;
    width: 14px;
    height: 14px;
    left: 311px;
    top: 662px;
    background: #FFFFFF;
`;

export const Container6 = styled.div`
    position: absolute;
    width: 14px;
    height: 14px;
    left: 311px;
    top: 770px;
    background: #FFFFFF;
`;

export const Container7 = styled.div`
    position: absolute;
    height: 148px;
    width: 315px;
    left: 30px;
    top: 304px;
    border-radius: 22px;
`;

export const Text8 = styled.text`
    position: absolute;
    height: 21px;
    width: 113px;
    left: 50px;
    top: 324px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 500;
    font-size: 14px;
    line-height: 21px;
    color: #FFFFFF;
`;

export const Text9 = styled.text`
    position: absolute;
    height: 21px;
    width: 57px;
    left: 50px;
    top: 350px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 500;
    font-size: 16px;
    line-height: 21px;
    color: #FFFFFF;
`;
